script: |
  super -f text -I q11674.spq | sort > q11674.out

inputs:
  - name: q11674.spq
    data: |
      SELECT col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL IS NULL OR NULL NOT IN ( - col1, col0, - - col0 + 22, ( + - col1 ) * + - col2 / - col1 );
  - name: tab2

outputs:
  - name: q11674.out
    data: |
      46
      64
      75
